import React, { useEffect, useState } from "react";

// CSS
import './Home.css';

// API
import { api } from "../../../utils/api";

const Home = () => {
    const [verify, setVerify] = useState<boolean>(false);

    useEffect(() => {
        api.get()
    }, [verify])

    return(
        <div>
            <h1>Home</h1>
        </div>
    );
}

export default Home;
